import React from "react";
import AboutImg from "../assets/images/profile-pic-4.png";
function AboutSection() {
  return (
    <div className="bg-primary text-light py-5" id="about">
      <div className="container">
        <div className="flex-column-reverse flex-md-row row">
          <div className="col-md-6 mt-md-0 d-flex flex-column justify-content-center align-items-ceneter">
            <img
              className="img-fluid rounded-lg w-75 shadow"
              src={AboutImg}
              alt="about img"
            />
          </div>
          <div className="col-md-6 d-flex flex-column justify-content-center">

          </div>
        </div>
      </div>
    </div>
  );
}

export default AboutSection;
